import React, { useEffect, useState } from "react";
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import CardContent from "@material-ui/core/CardContent";
import "./TopProg.css";
import { Typography, CardMedia } from "@material-ui/core";
import axios from "./axios";
import topProgs from "./data";

function TopProg() {
  const [progs, setprogs] = useState([]);

  const time = new Date().getUTCMilliseconds();
  const key = "ce72ebe1d56ebe106c52288686ac4c30c4539f07";
  const SecKey = "e4b23d29ca62a1d0adcf1c234120681bc2bd6941";

  topProgs.forEach((person) => {
    fetch(
      "https://codeforces.com/api/user.info?handles=" +
        person.handle +
        "&apiKey=" +
        key +
        "&time=" +
        time +
        "&apiSig=123456sha512Hex(123456/user.info?apiKey=" +
        key +
        "&handles=" +
        person.handle +
        "&time=" +
        time +
        "#" +
        SecKey +
        ")"
    )
      .then((res) => res.json())
      .then((data) => {
        progs.push({
          image: data.result[0].titlePhoto,
          name: {
            fname: data.result[0].firstName,
            lname: data.result[0].lastName,
          },
        });
      });
  });

  console.log(progs);

  return (
    <div className="topProgs">
      <h1>Top Competitive Programmers around the globe!</h1>
      <div className="topProgs_cards">
        <Card>
          <CardContent>
            <CardMedia
              style={{ height: "110px", width: "220px", paddingTop: "56.25%" }}
              image={
                "https://userpic.codeforces.com/512496/title/5e6e92ed0d9fc9f4.jpg"
              }
            />
            <Typography color="textPrimary">name</Typography>
          </CardContent>
        </Card>
      </div>
    </div>
  );
}

export default TopProg;

